    }
    return(
    <>
        <div>
            <input type="text" />
            <button>upload</button>
        </div>
        <div>
        <span>현제 시간 {clock}시</span>
        <button onClick={timeUpdate}>Update</button>
        </div>
    </>
    );
};

export default UseStateHookEx;
